import React from "react";
import { Link } from 'react-router-dom';

function Products() {
  return (
    <>
      <h1>The Products Page</h1>
      <li><Link>Product 1</Link></li>
      <li><Link>Product 1</Link></li>
      <li>Product 3</li>
      <li>Product 4</li>
    </>
  );
}

export default Products;
